function renderBookmarkedDesigns() {
  const bookmarks = {
    "aligned chevron path, cutout":
      "",
    "aligned chevron path, compact 60":
      "",
    "aligned chevron path, compact 90":
      "",
    "compact 90 with crossovers exterior":
      "",
    "aligned, large even spacing cutout":
      "",
    "aligned, large even spacing compact":
      "",
    "thin bois":
      "",
    "shabat shalom":
      "",
    "shabat, interior chevrons":
      "",
    "external crossover/mouth, clustered":
      "",
    "external crossover/mouth, spaced":
      "",
    "aligned per side":
      "",
  };

  for (bookmark in bookmarks) {
    document.getElementById(
      "bookmarkedDesigns"
    ).innerHTML += `<button class="design-options" onclick="window.location.hash = '#${bookmarks[bookmark]}'; loadFromURL();">${bookmark}</button>`;
  }
}
